        <div>
            {
                lienData.map((data) => (
                    <div >
                        
                        <br />
                        
                        <br />
                        {data.phrase}
                    </div>
                ))
            }
        </div>
    );
}

function loadAllImage(i) {

    let images = {};
    i.keys().map((item) => { images[item.replace('./', '')] = i(item); });

    return images;
}
